import React from 'react'
import './demo-article.css'


export default class DemoArticle extends React.Component {
    constructor() {
      super();

      this.state = {
        // articles: [
        //   {
            name: 'Artcile1',
            image: 'https://i.pinimg.com/originals/5d/6b/c3/5d6bc3ca3d5655769662474362ad3a7d.jpg',
            link_article: '/healthy-food',
            topic: 'Food'
        //   }  
        // ],
      };
    }

render(){
    return (
        <div className="art-block vPadding vShadow vBlock clear">
            <a rel="nofollow" href={this.state.link_article}>
                <div class="bImage">
                    <img src={this.state.image} width="314" height="200" border="0"></img> </div>
    <div class="vTitle vProxima vFont26 vHPadding15">{this.state.name}</div>
                <div class="vHeight10"></div>
                <div class="vHPadding15 clear">
                    <div class="frontLinkArrow"></div>
            </div></a>
    <a href={this.state.link_article} class="vCategory vFont14 vRobotoB vHPadding15">{this.state.topic}</a>
            <div class="vHeight10"></div>

        </div>
    );
    }
}


